local Easing = {}

do
    local Math = {
        Pow = math.pow, Sin = math.sin, Cos = math.cos, Pi = math.pi,
        Sqrt = math.sqrt, Abs = math.abs, ASin = math.asin
    }

    function Easing.Linear(t, b, c, d)
        return c * t / d + b
    end

    function Easing.QuartIn(t, b, c, d)
        t = t / d
        return c * Math.Pow(t, 4) + b
    end

    function Easing.QuartOut(t, b, c, d)
        t = t / d - 1
        return -c * (Math.Pow(t, 4) - 1) + b
    end

    function Easing.ElasticOut(t, b, c, d, a, p)
        if t == 0 then return b end; t = t / d; if t == 1 then return b + c end
        p = p or d * 0.3; local s = 0
        if not a or a < Math.Abs(c) then a = c; s = p / 4 else s = p / (2 * Math.Pi) * Math.ASin(c / a) end
        return a * Math.Pow(2, -10 * t) * Math.Sin((t * d - s) * (2 * Math.Pi) / p) + c + b
    end

    function Easing.BackOut(t, b, c, d, s)
        s = s or 1.70158; t = t / d - 1; return c * (t * t * ((s + 1) * t + s) + 1) + b
    end

    function Easing.BounceOut(t, b, c, d)
        t = t / d
        if t < 1/2.75 then return c * (7.5625 * t * t) + b
        elseif t < 2/2.75 then t = t - 1.5/2.75; return c * (7.5625 * t * t + 0.75) + b
        elseif t < 2.5/2.75 then t = t - 2.25/2.75; return c * (7.5625 * t * t + 0.9375) + b
        else t = t - 2.625/2.75; return c * (7.5625 * t * t + 0.984375) + b
        end
    end
end

