        if ExecutorName ~= "Wave Windows" then
            hookfunction(AAAAAAAAA, BBBBBBBBB)

            if isfunctionhooked(AAAAAAAAA) == false then
                while true do end
            end
        end

        if isfunctionhooked(type) then
            while true do end
        end

        if type(Function) ~= "function" then continue end

        if isfunctionhooked(Function) then
            while true do end
        end
    end

    return true
end

