do
    function Utility:GetAliveInfo(Player)
        local Alive = Player.Status.Alive.Value
        if not Alive then return end

        local Character = Player.Character

        local Success, Head, Humanoid, RootPart = pcall(function()
            return Character.Head, Character.Humanoid, Character.HumanoidRootPart
        end)

        if not Success or Humanoid.Health <= 0 then return end

        return true, Character, RootPart, Head, Humanoid
    end

    function Utility:VisibleCheck(Character, Origin, Position)
        Utility.RayParams.FilterDescendantsInstances = {Character, unpack(table.clone(Ragebot.Ignores))}

        return not Workspace:Raycast(Origin, Position - Origin, Utility.RayParams)
    end
end

