    function Visuals.Viewmodel()
        local Viewmodel = Camera:FindFirstChild('Arms')
        if not Viewmodel then return end

        Utility.Destroy(Viewmodel:FindFirstChild('AnimSaves'))

        local Arms = Viewmodel:FindFirstChildOfClass('Model')

