        end

        if not flags['Visual/ViewmodelEnabled'] then return end

        local UseFade = flags['Visual/TransparencyFade']
        local CurrentTransparency = 0
        if UseFade then
            local Min = 1 - (flags['Visual/MaximumTransparency']) / 100
            local Max = 1 - (flags['Visual/MinimumTransparency']) / 100

            CurrentTransparency = Min + (Max - Min) * (Visuals.ViewmodelTweenValue and Visuals.ViewmodelTweenValue.Value)
