                -- Determine transparency based on flags
                local ArmTransparency = (flags['Visual/RemoveArms'] and 1) or (UseFade and table.find(FadeOn, 'Arms') and CurrentTransparency) or (flags['Visual/ArmsColor'] and flags['Visual/ArmsColor'].Transparency) or 0
                local ViewmodelTransparency = (UseFade and table.find(FadeOn, 'Weapon') and CurrentTransparency) or (flags['Visual/WeaponColor'] and flags['Visual/WeaponColor'].Transparency) or 0

                if ViewmodelPart.ClassName == 'Part' and EffectOnWeapon then
                    ViewmodelPart.Color = flags['Visual/WeaponColor'].Color
                    ViewmodelPart.Material = flags['Visual/WeaponMaterial']
                    ViewmodelPart.Transparency = ViewmodelTransparency
                elseif ViewmodelPart.ClassName == 'MeshPart' and EffectOnWeapon then
                    ViewmodelPart.TextureID = (flags['Visual/WeaponMaterial'] == 'ForceField' and (flags['Visual/ForceFieldAnimation'] and Visuals.Textures[ flags['Visual/FFAnimation'] ])) or '' -- Updated flag name
                    ViewmodelPart.Color = flags['Visual/WeaponColor'].Color
                    ViewmodelPart.Material = flags['Visual/WeaponMaterial']
                    ViewmodelPart.Transparency = ViewmodelTransparency
                elseif ViewmodelPart.ClassName == 'Model' and EffectOnArms and ViewmodelPart:FindFirstChild("Left Arm") then
                    ViewmodelPart["Left Arm"].Color = flags['Visual/ArmsColor'].Color
                    ViewmodelPart["Right Arm"].Color = flags['Visual/ArmsColor'].Color
                    ViewmodelPart["Left Arm"].Transparency = ArmTransparency
                    ViewmodelPart["Right Arm"].Transparency = ArmTransparency
                    ViewmodelPart["Left Arm"].Material = flags['Visual/ArmsMaterial']
                    ViewmodelPart["Right Arm"].Material = flags['Visual/ArmsMaterial']
                end
            end
        end)
    end

    function Visuals.InitializeViewmodelTween()
        if Visuals.ViewmodelTween then
            thread(pcall, function()
                Visuals.ViewmodelTween:Cancel()
                Visuals.ViewmodelTween:Destroy()
                Visuals.ViewmodelTween = nil
            end)
        end

        local FadeSpeed = flags['Visual/TransparencyFadeSpeed'] or 1 -- Default speed if flag not found
        local Style = flags['Visual/EasingStyle'] or 'Linear'

        local EasingStyleEnum = Enum.EasingStyle[Style]

        local TweenInfoInstance = TweenInfo.new(
            1 / FadeSpeed,           -- Duration
            EasingStyleEnum,     -- EasingStyle
            Enum.EasingDirection.InOut, -- EasingDirection (InOut looks good for fades)
            -1,                  -- RepeatCount (-1 for infinite)
            true,                -- Reverses
            flags['Visual/TransparencyFadeDelay'] or 0                    -- DelayTime
        )

        Visuals.ViewmodelTween = TweenService:Create(Visuals.ViewmodelTweenValue, TweenInfoInstance, { Value = 1 })
        Visuals.ViewmodelTweenValue.Value = 0 -- Start at 0
        Visuals.ViewmodelTween:Play()
    end

    function Visuals.DamageListener(PlayerDamageFolder)
        local Damage = PlayerDamageFolder.DMG
        local DamageDealt = Damage.Value

        local Weapon = tostring(Client.gun)

        local function LogDamage(damageDealt, totalDamage)
            if flags['Visual/HitLogEnabled'] then
                if damageDealt == 0 then
                    return Visuals.Log('hit registration failed, due to target is using god mode exploit', flags['Visual/HitLogType'], flags['Visual/HitLogLifeTime'])
                end

                Visuals.Log('hit ' .. string.lower(PlayerDamageFolder.Name) .. ' in ' .. string.lower((Visuals.LastHitPart and Visuals.LastHitPart.Name) or 'unknown') .. ' for: ' .. damageDealt .. ' with ' .. string.lower(Weapon) ..' , health remaining: ' ..  math.clamp(100 - totalDamage, 0, 100), flags['Visual/HitLogType'], flags['Visual/HitLogLifeTime'])
            end

            if Visuals.LastHitPart then
                Visuals.ShowDamageNumber(math.floor(damageDealt), Visuals.LastHitPart.Position, string.find(Visuals.LastHitPart.Name, 'Head'), Players[Visuals.LastHitPart.Parent.Name].Team ~= LocalPlayer.Team)
            end
        end

        LogDamage(DamageDealt, DamageDealt)

        if DamageDealt < 100 then
            local PreviousDamage = DamageDealt
            local Connection; Connection = Damage:GetPropertyChangedSignal('Value'):Connect(function()
                task.delay(1/30, function()
                    local NewDamage = Damage.Value
                    local NewDamageDealt = NewDamage - PreviousDamage

                    PreviousDamage = NewDamage

                    LogDamage(NewDamageDealt, NewDamage)

                    if PreviousDamage >= 100 then
                        Connection:Disconnect()
                    end
                end)
            end)
        end
    end

