    function Visuals:CreateBulletTracer(Origin, EndPosition, Color, LifeTime, Texture, Style, FadeSpeed, Type)
        if Type == 'Drawing' then
            return thread(function()
                local Tracer = Drawing.new('Line')

                Tracer.ZIndex = 100
                Tracer.Thickness = .1
                Tracer.Transparency = 1 - Color.Transparency

                local StartTick = tick()

                while true do
                    local Delta = task.wait(1/90)
                    local NewTick = tick()

                    local LineVector = (EndPosition - Origin)
                    local LineLength = LineVector.Magnitude
                    local LineDirection = LineVector.Unit

                    local NumSegments = 20
                    local SegmentLength = LineLength / NumSegments

                    local VisibleStart, VisibleEnd

                    for i = 0, NumSegments do
                        local Point = Origin + LineDirection * (i * SegmentLength)
                        local ScreenPoint = Utility.ToViewportPoint(Point)

                        if ScreenPoint.Z > 0 then
                            if not VisibleStart then
                                VisibleStart = Point
                            end

                            VisibleEnd = Point
                        end
                    end

                    Tracer.Visible = (VisibleStart and VisibleEnd and true) or false

                    if Tracer.Visible then
                        local StartScreen = Utility.ToViewportPoint(VisibleStart)
                        local EndScreen = Utility.ToViewportPoint(VisibleEnd)

                        local DepthScale = math.min(1, 1 / math.max(StartScreen.Z, EndScreen.Z))

                        Tracer.Thickness = DepthScale * .1
                        Tracer.Color = Color.Color

                        Tracer.From = Vector2.new(StartScreen.X, StartScreen.Y)
                        Tracer.To = Vector2.new(EndScreen.X, EndScreen.Y)
                    end

                    if NewTick - StartTick >= LifeTime then
                        Tracer.Transparency = Utility:Fade(Tracer.Transparency, 0, FadeSpeed, Delta, Style)
                    end

                    if Tracer.Transparency <= 0 then
                        return Tracer:Remove()
                    end
                end
            end)
        end

        return thread(function()
            local OriginAttachment = Utility:Create("Attachment", {
                Position = Origin,
                Parent = Workspace.Terrain
            })

            local EndAttachment = Utility:Create("Attachment", {
                Position = EndPosition,
                Parent = Workspace.Terrain
            })

            local Beam = Utility:Create("Beam", {
                Texture = Visuals.Textures[Texture],
                LightEmission = 1,
                LightInfluence = 0,
                TextureSpeed = 10,
                Color = ColorSequence.new{ColorSequenceKeypoint.new(0, Color3.new()), ColorSequenceKeypoint.new(.1, Color.Color), ColorSequenceKeypoint.new(.9, Color.Color), ColorSequenceKeypoint.new(1, Color3.new())},
                Width0 = 1.2,
                Width1 = 1.2,
                Attachment0 = OriginAttachment,
                Attachment1 = EndAttachment,
                Enabled = true,
                Parent = Workspace
            })

            task.wait(LifeTime)

            local NumberValue = Instance.new("NumberValue");
            NumberValue.Value = 0

            NumberValue.Changed:Connect(function(NewValue)
                Beam.Transparency = NumberSequence.new{NumberSequenceKeypoint.new(0, NewValue), NumberSequenceKeypoint.new(1, NewValue)}
            end)

            local TweenInfo = TweenInfo.new(1 / FadeSpeed, Enum.EasingStyle[Style], Enum.EasingDirection.InOut)
            local Tween = TweenService:Create(NumberValue, TweenInfo, { Value = 1 })
            Tween:Play()

            Tween.Completed:Wait()

            Tween:Destroy()
            NumberValue:Destroy()
            OriginAttachment:Destroy()
            EndAttachment:Destroy()
            Beam:Destroy()
        end)
    end

    function Visuals.OnTrailFired(Origin, Target)
        if not flags['Visual/BulletTracerEnabled'] then return end

        local Infos = {}

        foreach(ESP.Players, function(Player)
            local Success, Flash = pcall(function()
                return Player.Character.Gun.Flash
            end)

            if not Success then return end

            table.insert(Infos, {
                Player = Player,
                Distance = (Origin.Position - Flash.Position).Magnitude
            })
        end)

        table.sort(Infos, function(a, b)
            return a.Distance < b.Distance
        end)

        local ClosestPlayer = Infos[1] and Infos[1].Player
        if not ClosestPlayer then return end

        local ProjectileType = (ClosestPlayer.Team == LocalPlayer.Team and 'Team') or 'Enemy'

        if table.find(flags['Visual/BulletTracerInclude'], ProjectileType) then
            Visuals:CreateBulletTracer(Origin.Position, Target, flags['Visual/BulletTracer'..ProjectileType..'Color'], flags['Visual/BulletTracerLifeTime'], flags['Visual/BulletTracerTexture'], flags['Visual/BulletTracerStyle'], flags['Visual/BulletTracerFadeSpeed'], flags['Visual/BulletTracerType'])
        end
    end

