    Visuals.HatLastRender = 0
    Visuals.CircleHatDrawings = {}

    function Visuals:ClearChinaHatDrawings()
        for _, Objects in Visuals.CircleHatDrawings do
            Objects.Line:Remove()
            Objects.Triangle:Remove()
        end

        Visuals.CircleHatDrawings = {}
    end

    function Visuals:InitChinaHat()
        Visuals:ClearChinaHatDrawings()

        local MaxSides = flags["Visual/CircleHatSides"] or 25

        for Index = 1, MaxSides do
            Visuals.CircleHatDrawings[Index] = {
                Line = Drawing.new("Line"),
                Triangle = Drawing.new("Triangle")
            }

            Visuals.CircleHatDrawings[Index].Line.ZIndex = 2
            Visuals.CircleHatDrawings[Index].Line.Thickness = 2

            Visuals.CircleHatDrawings[Index].Triangle.ZIndex = 1
            Visuals.CircleHatDrawings[Index].Triangle.Filled = true
        end
    end

    function Visuals.RenderChinaHat()
        if not flags["Visual/CircleHatEnabled"] then
            return Visuals:ClearChinaHatDrawings()
        end

        local CurrentSides = flags["Visual/CircleHatSides"] or 25

        if #Visuals.CircleHatDrawings ~= CurrentSides then
            Visuals:InitChinaHat()
        end

        local NewTick = tick()
        if NewTick - Visuals.HatLastRender < 1/90 then return end

        Visuals.HatLastRender = NewTick

        local Character = LocalPlayer.Character
        local CanRender = Character and Character:FindFirstChild('Head')

        for Index = 1, #Visuals.CircleHatDrawings do
            local CurrentLine = Visuals.CircleHatDrawings[Index].Line
            local CurrentTriangle = Visuals.CircleHatDrawings[Index].Triangle

            if not CanRender then
                CurrentLine.Visible = false
                CurrentTriangle.Visible = false
                continue
            end

            local TwoPi = math.pi * 2
            local Radius = flags["Visual/CircleHatRadius"]
            local Height = flags["Visual/CircleHatHeight"]
            local YOffset = flags["Visual/CircleHatYOffset"]
            local HatTransparency = flags["Visual/CircleHatTransparency"]
            local OutlineTransparency = flags["Visual/CircleOutlineTransparency"]

            local CurrentColor = (flags["Visual/CircleHatRainbow"] and Color3.fromHSV((NewTick % 5 / 5 - (Index / #Visuals.CircleHatDrawings)) % 1, 0.5, 1)) or flags["Visual/CircleHatColor"].Color

            local HeadPosition = Character.Head.Position + Vector3.new(0, YOffset, 0)
            local TopPosition = HeadPosition + Vector3.new(0, Height, 0)

            local CurrentAngle = (Index / CurrentSides) * TwoPi
            local NextAngle = ((Index + 1) / CurrentSides) * TwoPi

            local CurrentWorldPoint = HeadPosition + (Vector3.new(math.cos(CurrentAngle), 0, math.sin(CurrentAngle)) * Radius)
            local NextWorldPoint = HeadPosition + (Vector3.new(math.cos(NextAngle), 0, math.sin(NextAngle)) * Radius)

            local CurrentScreenPoint = Camera:WorldToViewportPoint(CurrentWorldPoint)
            local NextScreenPoint = Camera:WorldToViewportPoint(NextWorldPoint)
            local TopScreenPoint = Camera:WorldToViewportPoint(TopPosition)

            if CurrentScreenPoint.Z < 0 or NextScreenPoint.Z < 0 or TopScreenPoint.Z < 0 then
                CurrentLine.Visible = false
                CurrentTriangle.Visible = false
                continue
            end

            CurrentLine.From = Vector2.new(CurrentScreenPoint.X, CurrentScreenPoint.Y)
            CurrentLine.To = Vector2.new(NextScreenPoint.X, NextScreenPoint.Y)
            CurrentLine.Color = CurrentColor
            CurrentLine.Transparency = OutlineTransparency
            CurrentLine.Visible = true

            CurrentTriangle.PointA = Vector2.new(TopScreenPoint.X, TopScreenPoint.Y)
            CurrentTriangle.PointB = CurrentLine.From
            CurrentTriangle.PointC = CurrentLine.To
            CurrentTriangle.Color = CurrentColor
            CurrentTriangle.Transparency = HatTransparency
            CurrentTriangle.Visible = true
        end
    end

    function Visuals.CleanupWeaponModel()
        if Visuals.WeaponModelInstance then
            Visuals.WeaponModelInstance:Destroy()
        end
    end

    function Visuals.InitializeWeaponModel()
        Visuals.CleanupWeaponModel()

        local WeaponModel = (function()
            for _, WeaponModel in Visuals.WeaponModels do
                if WeaponModel.Name == flags['Visual/WeaponModel'] then
                    return WeaponModel
                end
            end
        end)()

        if not WeaponModel then return warn("Weapon model not found") end

        Visuals.WeaponModelInstance = WeaponModel:Clone()
        Visuals.WeaponModelInstance.Parent = Camera
        Visuals.WeaponOriginalAppearance = {}

        for _, Part in Visuals.WeaponModelInstance:GetDescendants() do
            pcall(function()
                Visuals.WeaponOriginalAppearance[Part] = {
                    TextureID = Part.TextureID
                }
            end)

            pcall(function()
                Part.Anchored = true
                Part.CanCollide = false
            end)
        end

        WeaponModel.Parent = Workspace
    end

    function Visuals.UpdateWeaponModel(Delta)
        if not flags['Visual/WeaponEnabled'] then
            if Visuals.WeaponModelInstance and Visuals.WeaponModelInstance.Parent then
                 Visuals.CleanupWeaponModel()
            end
            return
        end

        Visuals.InitializeWeaponModel()

        local Character = LocalPlayer.Character
        local RootPart = Character and FindChild(Character, "HumanoidRootPart")

        if not RootPart then return end

        if not Visuals.WeaponModelInstance.Parent then
            Visuals.WeaponModelInstance.Parent = Camera
        end

        local OffsetX = flags['Visual/WeaponOffsetX']
        local OffsetY = flags['Visual/WeaponOffsetY']
        local OffsetZ = flags['Visual/WeaponOffsetZ']

        local Color = flags['Visual/WeaponColor'].Color
        local Transparency = flags['Visual/WeaponColor'].Transparency
        local Material = Enum.Material[flags['Visual/WeaponModelMaterial']]
        local RotationSpeed = flags['Visual/WeaponRotationSpeed']
        local RotationAxes = flags['Visual/WeaponRotationAxes']

        Visuals.WeaponCurrentRotation = CFrame.new()

        if not Visuals.WeaponSpinAmount then
            Visuals.WeaponSpinAmount = 0
        end

        Visuals.WeaponSpinAmount += Delta * RotationSpeed

        if Visuals.WeaponSpinAmount > 360 then
            Visuals.WeaponSpinAmount = 0
        end

        local RotateX = ((table.find(RotationAxes, 'X') and Visuals.WeaponSpinAmount) or 0) + (flags['Visual/WeaponRotationX'] or 0)
        local RotateY = ((table.find(RotationAxes, 'Y') and Visuals.WeaponSpinAmount) or 0) + (flags['Visual/WeaponRotationY'] or 0)
        local RotateZ = ((table.find(RotationAxes, 'Z') and Visuals.WeaponSpinAmount) or 0) + (flags['Visual/WeaponRotationZ'] or 0)

        Visuals.WeaponCurrentRotation *= CFrame.Angles(RotateX, RotateY, RotateZ)

        local OffsetVector = Vector3.new(OffsetX, OffsetY, OffsetZ)

        Visuals.WeaponModelInstance:PivotTo(CFrame.new(RootPart.Position) * Visuals.WeaponCurrentRotation * CFrame.new(OffsetVector))

        for _, Part in Visuals.WeaponModelInstance:GetDescendants() do
            if not (Part and Part.Parent) then continue end

            pcall(function()
                Part.TextureID = (flags['Visual/WeaponRemoveTexture'] and '') or Visuals.WeaponOriginalAppearance[Part].TextureID
            end)

            pcall(function()
                Part.Color = Color
                Part.Material = Material
                Part.Transparency = Transparency
            end)
        end

        local Chams = game.FindFirstChild(Visuals.WeaponModelInstance, 'Highlight') or Instance.new('Highlight', Visuals.WeaponModelInstance)
        Chams.Adornee = Visuals.WeaponModelInstance
        Chams.Enabled = flags['Visual/WeaponChamsEnabled']

        if Chams.Enabled then
            local FillColor = flags['Visual/WeaponChamsColor1'].Color
            local OutlineColor = flags['Visual/WeaponChamsColor2'].Color
            local FillTransparency = flags['Visual/WeaponChamsColor1'].Transparency
            local OutlineTransparency = flags['Visual/WeaponChamsColor2'].Transparency

            Chams.FillColor = FillColor
            Chams.FillTransparency = FillTransparency
            Chams.OutlineColor = OutlineColor
            Chams.OutlineTransparency = OutlineTransparency
        end
    end

    function Visuals.PreloadDigitImages()
