    function Visuals.CleanupDamageNumbers()
        if Visuals.DamageNumberConnection then
            Visuals.DamageNumberConnection:Disconnect()
            Visuals.DamageNumberConnection = nil
        end

        for _, DamageNumber in Visuals.ActiveDamageNumbers do
            for _, Image in DamageNumber.Images do Image:Remove() end
        end

