    function Visuals.ShowDamageNumber(Number, WorldPosition, IsHeadshot, IsEnemy)
        if Number ~= Number then return end

        if Number > 9999 then
            Number = 9999
        end

        local OffsettedWorldPosition = WorldPosition

        if flags["Visual/DamageNumberRandomOffsetEnabled"] then
            local MaxOffset = flags["Visual/DamageNumberMaxRandomOffset"]
            local RandomOffsetX = (math.random() * 2 - 1) * MaxOffset
            local RandomOffsetZ = (math.random() * 2 - 1) * MaxOffset
            OffsettedWorldPosition = WorldPosition + Vector3.new(RandomOffsetX, 0, RandomOffsetZ)
        end

        local DigitString = tostring(Number)
        local Images = {}
        local BaseSize = flags["Visual/DamageNumberBaseSize"]
        local BaseHeight = flags["Visual/DamageNumberBaseHeight"]
        local TotalWidth = #DigitString * BaseSize

        local ScreenPosition, OnScreen = Camera.WorldToViewportPoint(Camera, OffsettedWorldPosition)
        if not OnScreen then return end

        local StartX = ScreenPosition.X - TotalWidth/2
        local StartY = ScreenPosition.Y - 24

        local TextColor = Color3.new(1,1,1)
        if IsHeadshot and flags['Visual/DamageNumberUseHeadshotColor'] then
            TextColor = flags['Visual/DamageNumberHeadshotColor'].Color
        elseif IsEnemy then
            TextColor = flags['Visual/DamageNumberEnemyColor'].Color
        else
            TextColor = flags['Visual/DamageNumberTeamColor'].Color
        end

        table.insert(Visuals.ActiveDamageNumbers, {
            Images = Images,
            WorldPosition = OffsettedWorldPosition,
            StartTime = tick(),
            Duration = (flags["Visual/DamageNumberBaseDuration"]) / (flags["Visual/DamageNumberSpeedMultiplier"]),
            Digits = #DigitString,
            BaseColor = TextColor,
            _DigitString = DigitString
        })

        local NewDamageNumber = Visuals.ActiveDamageNumbers[#Visuals.ActiveDamageNumbers]

        for i = 1, #DigitString do
            local Digit = tonumber(string.sub(DigitString, i, i))
            local Image = Drawing.new("Image")

            if Visuals.DigitImages[Digit] and Visuals.DigitImages[Digit].Data then
                Image.Data = Visuals.DigitImages[Digit].Data
            elseif Visuals.Base64DigitData[Digit + 1] and type(Visuals.Base64DigitData[Digit + 1]) == "string" then
                Image.Data = base64.decode(Visuals.Base64DigitData[Digit + 1])
            else
                continue
            end

            Image.Size = Vector2.new(BaseSize, BaseHeight)
            Image.Position = Vector2.new(StartX + (i-1) * BaseSize, StartY)
            Image.Visible = false
            Image.Color = TextColor

            table.insert(Images, Image)
        end

        NewDamageNumber.Images = Images
        NewDamageNumber._DigitString = nil
    end

    function Visuals.UpdateDamageNumbers()
        if not flags["Visual/DamageNumberEnabled"] then return end

        local CurrentTime = tick()
        local CameraPosition = Camera.CFrame.Position

        for Index = #Visuals.ActiveDamageNumbers, 1, -1 do
            local DamageNumber = Visuals.ActiveDamageNumbers[Index]
            local ElapsedTime = CurrentTime - DamageNumber.StartTime
            local Progress = ElapsedTime / DamageNumber.Duration

            if Progress > 1 then
                for _, Image in DamageNumber.Images do
                    Image:Remove()
                end

                table.remove(Visuals.ActiveDamageNumbers, Index)

                continue
            end

            local CurrentScreenPosition, OnScreen = Camera.WorldToViewportPoint(Camera, DamageNumber.WorldPosition)
            if not OnScreen then
                for _, Image in DamageNumber.Images do
                    Image.Visible = false
                end

                continue
            end

            local DistanceScaleFactor = 1

            if flags["Visual/DamageNumberDistanceScalingEnabled"] then
                local Distance = (CameraPosition - DamageNumber.WorldPosition).Magnitude

                local MinDist = flags["Visual/DamageNumberMinDistance"]
                local MaxDist = flags["Visual/DamageNumberMaxDistance"]
                local MinScaleDist = flags["Visual/DamageNumberMinDistanceScale"]
                local MaxScaleDist = flags["Visual/DamageNumberMaxDistanceScale"]

                if Distance <= MinDist then
                    DistanceScaleFactor = MaxScaleDist
                elseif Distance >= MaxDist then
                    DistanceScaleFactor = MinScaleDist
                else
                    local LerpAlpha = (Distance - MinDist) / (MaxDist - MinDist)
                    DistanceScaleFactor = MaxScaleDist + LerpAlpha * (MinScaleDist - MaxScaleDist)
                end
            end

            local CurrentBaseSize = (flags["Visual/DamageNumberBaseSize"]) * DistanceScaleFactor
            local CurrentBaseHeight = (flags["Visual/DamageNumberBaseHeight"]) * DistanceScaleFactor

            local BaseFade = Easing.QuartIn(Progress, 0, 1, 1)
            local Transparency = 1 * (1 - BaseFade)
            local RiseAmount = BaseFade

            local CurrentTotalWidth = DamageNumber.Digits * CurrentBaseSize
            local CurrentBaseX = CurrentScreenPosition.X - CurrentTotalWidth / 2
            local CurrentBaseY = CurrentScreenPosition.Y - 24

            for DigitIndex, Image in DamageNumber.Images do
                local DigitDuration = 1 + DigitIndex * 0.25
                local DigitProgress = ElapsedTime / (DamageNumber.Duration * DigitDuration / DamageNumber.Digits)

                if DigitProgress > 0 then
                    Image.Visible = true

                    local ElasticEffect = Easing.ElasticOut(ElapsedTime, 0, 1, DigitDuration) - BaseFade
                    local AnimationScale = (flags["Visual/DamageNumberMinScale"]) + ElasticEffect * (flags["Visual/DamageNumberMaxScale"])
                    local YOffset = -(flags["Visual/DamageNumberRiseHeight"]) * RiseAmount

                    local Alpha = 1
                    if Progress > (flags["Visual/DamageNumberFadeStartPoint"]) then
                        Alpha = Transparency
                    end

                    local Spacing = CurrentBaseSize * AnimationScale
                    local CenterOffset = (DamageNumber.Digits * Spacing - CurrentTotalWidth) / 2

                    Image.Position = Vector2.new(
                        CurrentBaseX + (DigitIndex - 1) * Spacing - CenterOffset,
                        CurrentBaseY + YOffset
                    )
                    Image.Size = Vector2.new(CurrentBaseSize * AnimationScale, CurrentBaseHeight * AnimationScale)
                    Image.Transparency = Alpha
                    Image.Color = DamageNumber.BaseColor

                    continue
                end

                Image.Visible = false
            end
        end
    end

    function Visuals:InitializeDamageNumbers()
        -- Visuals.PreloadDigitImages()
        if Visuals.DamageNumberConnection then Visuals.DamageNumberConnection:Disconnect() end

        Visuals.DamageNumberConnection = RunService.Heartbeat:Connect(Visuals.UpdateDamageNumbers)
    end
end

---------------------------//ESP//------------------------------

do
    function ESP:ObjectCheck(Object)
        if not (Object and typeof(Object) == 'Instance') then return end

        local Class = Object.ClassName
        return Class ~= 'Tween' and Class ~= 'NumberValue' and Class ~= 'UIGradient' and Class ~= 'Highlight'
    end

    function ESP.GetWeaponIcon(WeaponName)
        return GetIcon.getWeaponOfKiller(WeaponName)
    end

    function ESP:SetTransparency(Object, Value)
        local Class = Object.ClassName
        local TransparencyProperty =
            (Class == 'TextLabel' and 'TextTransparency') or
            (Class == 'ImageLabel' and 'ImageTransparency') or
            'Transparency'

        local Transparency = Object[TransparencyProperty]
        local IsBlacklisted = Object.Name == 'Box' or Object.Name == 'BoxOutlineHolder'
        if not Transparency or (Transparency == Value and not IsBlacklisted) then return end

        Value = math.clamp(Value, 0, 1)

        Object[TransparencyProperty] = Value
    end

    function ESP:HideESP(PlayerESP, NoAnimation, FlagName)
        if not PlayerESP then return end

        thread(function()
            local ChamsObject = PlayerESP.Chams

            if NoAnimation then
                if PlayerESP.Hid then
                    for _, Tween in PlayerESP.Hid do
                        Tween:Pause()
                        Tween:Destroy()
                    end

                    PlayerESP.Hid = false
                end

                for _, Object in PlayerESP do
                    if not ESP:ObjectCheck(Object) then continue end

                    self:SetTransparency(Object, 1)
                end

                PlayerESP.LastColor = nil
                ChamsObject.Enabled = false
                return
            end

            if PlayerESP.Hid then return end

            PlayerESP.Hid = {}

            local Style = flags['ESP/EasingStyle'..FlagName]
            local FadeSpeed = 1 / flags['ESP/TransparencyFadeSpeed'..FlagName]

            for _, Object in PlayerESP do
                if not ESP:ObjectCheck(Object) then continue end

                local TransparencyProperty =
                    (Object.ClassName == 'TextLabel' and 'TextTransparency') or
                    (Object.ClassName == 'ImageLabel' and 'ImageTransparency') or
                    'Transparency'

                local Tween = TweenService:Create(Object, TweenInfo.new(FadeSpeed, Enum.EasingStyle[Style]), { [ TransparencyProperty ] = 1 })
                table.insert(PlayerESP.Hid, Tween)
                Tween:Play()
            end

            task.delay(FadeSpeed + 0.1, function()
                if PlayerESP then
                    PlayerESP.Hid = false
                end
            end)

            ChamsObject.FillTransparency = 1
            ChamsObject.OutlineTransparency = 1
        end)
    end

    function ESP:ShowESP(PlayerESP, FlagName)
        if not PlayerESP then return end

        PlayerESP.Chams.Enabled = true

        for _, Object in PlayerESP do
            if not ESP:ObjectCheck(Object) then continue end

            local Target = (Object.ClassName == 'Frame' and (Object.Name == 'Box' or Object.Name == 'BoxOutlineHolder') and ((flags['ESP/BoxEnabled'..FlagName] and table.find(flags['ESP/Sets'..FlagName], 'Filled Box') and flags['ESP/BoxFillColor'..FlagName].Transparency) or 1)) or 0
            self:SetTransparency(Object, Target)
        end
    end

    function ESP.AddPlayer(Player)
        if ESP.Players[Player] or Player == LocalPlayer then return end

        ESP.Players[Player] = {
            DeadColor = nil,
            LastHealth = 0,
            IsHitting = false,
            HitDetectionAlpha = 1,

            HealthTween = nil,

            HealthFade = Instance.new('NumberValue'),

            Chams = Utility:Create("Highlight", {
                Parent = ESP.ESPHolder,
                Enabled = true,
                FillTransparency = 1,
                OutlineTransparency = 1
            })
        }

        local Drawings = ESP.Players[Player]
        Drawings.HealthFade.Value = 0

        return Drawings
    end

    function ESP.RemovePlayer(Player)
        local Drawings = ESP.Players[Player]
        if not Drawings then return end

        ESP.Players[Player] = nil

        for _,_Instance in Drawings do
            if typeof(_Instance) ~= 'Instance' then continue end
            _Instance:Destroy()
        end
    end

    function ESP.Render(Delta)
        local CurrentTick = tick()
        if CurrentTick - ESP.LastRender < FPS90 then return end

        if Delta < FPS90 then Delta = FPS90 end

        ESP.RainbowColor = nil
        ESP.LastRender = CurrentTick

        local ThirdPersonEnabled = flags['Visual/ThirdPersonEnabled'] and flags['Visual/ThirdPerson'].Active

        local OldCameraCFrame = Camera.CFrame

        if ThirdPersonEnabled then
            Camera.CFrame *= CFrame.new(flags['Visual/XOffset'], flags['Visual/YOffset'], flags['Visual/ZOffset'])
        end

        for Player, Drawings in ESP.Players do
            local TeamFlag = Player and ((Player.Team == LocalPlayer.Team and 'Team') or 'Enemy')
            if not TeamFlag or not flags['ESP/Enabled' .. TeamFlag] then ESP:HideESP(Drawings, true) continue end

            local _, Character, RootPart, _, Humanoid = Utility:GetAliveInfo(Player)

            local IsFading = not RootPart and Drawings.DeadPosition
            if not RootPart and not IsFading then ESP:HideESP(Drawings, false, TeamFlag) continue end

            local HealthStyle = flags['ESP/HealthEasingStyle'..TeamFlag]
            local HealthFadeSpeed = 1 / flags['ESP/HealthFadeSpeed'..TeamFlag]
            local HitDetectionStyle = flags['ESP/HitDetectionEasingStyle'..TeamFlag]

            if IsFading then
                ESP:HideESP(Drawings, false, TeamFlag)
            else
                ESP:ShowESP(Drawings, TeamFlag)
            end

            local Position = (RootPart and RootPart.Position) or Drawings.DeadPosition
            local Distance = (Camera.CFrame.Position - (Position or Zero)).Magnitude
            if Distance > flags['ESP/MaxDistance' .. TeamFlag] then ESP:HideESP(Drawings, true) continue end

            local ScreenPosition, OnScreen = Camera.WorldToScreenPoint(Camera, Position)
            if not OnScreen then ESP:HideESP(Drawings, true) continue end

            local ScaleFactor = 1 / (ScreenPosition.Z * math.tan(math.rad(Camera.FieldOfView * 0.5)) * 2) * 1000
            if ScaleFactor < 1 then ScaleFactor = 1 end

            local Width, Height, Health = (Camera.ViewportSize.X / 409.6) * ScaleFactor, (Camera.ViewportSize.Y / 144) * ScaleFactor, (not RootPart and 0) or (Humanoid.Health <= 0 and 0 or Humanoid.Health) / Humanoid.MaxHealth
            local XOffset, YOffset = ScreenPosition.X - Width / 2, ScreenPosition.Y - Height / 2

            if Health ~= Drawings.LastHealth then
                if Drawings.HealthTween then
                    thread(pcall, function()
                        Drawings.HealthTween:Pause()
                        Drawings.HealthTween:Destory()
                    end)
                end

                Drawings.LastHealth = Health

                Drawings.HealthTween = TweenService:Create(Drawings.HealthFade, TweenInfo.new(HealthFadeSpeed, Enum.EasingStyle[HealthStyle]), { Value = Health })
                Drawings.HealthTween:Play()
            end

            if RootPart then Drawings.DeadPosition = RootPart.Position end

            if Drawings.IsHitting then
                Drawings.HitDetectionAlpha = Utility:Fade(Drawings.HitDetectionAlpha, 0, flags['ESP/HitDetectionSpeed'..TeamFlag], Delta, HitDetectionStyle)
                if Drawings.HitDetectionAlpha <= 0 then
                    Drawings.HitDetectionAlpha = 1
                    Drawings.IsHitting = false
                end
            end

            local IsHitting = flags['ESP/HitDetection'..TeamFlag] and Drawings.IsHitting

            local RainbowEnabled = flags['ESP/RainbowEnabled' .. TeamFlag]

            if RainbowEnabled then
                local Hue = (CurrentTick * flags['ESP/RainbowSpeed'..TeamFlag] / 10) % 1

                ESP.Color1 = Color3.fromHSV(Hue, 1, 1)
                ESP.Color2 = Color3.fromHSV((Hue + 0.5) % 1, 1, 1)
                ESP.RainbowColor = ColorSequence.new{
                    ColorSequenceKeypoint.new(0, ESP.Color1),
                    ColorSequenceKeypoint.new(1, ESP.Color2)
                }
            end

            local IsFriend = flags['ESP/FriendCheck' .. TeamFlag] and LocalPlayer:IsFriendsWith(Player.UserId)
            local IsVisible = RootPart and not IsFriend and flags['ESP/VisibleCheckEnabled' .. TeamFlag] and Distance <= flags['ESP/VisibleCheckDistance' .. TeamFlag] and Utility:VisibleCheck(Character, Camera.CFrame.Position, RootPart.Position)

            local HitColor = (IsHitting and flags['ESP/HitColor'..TeamFlag].Color)
            local ForceColor = (IsFading and Drawings.LastColor) or (IsFriend and flags['ESP/FriendColor' .. TeamFlag].Color) or (IsVisible and flags['ESP/VisibleCheckColor' .. TeamFlag].Color)

            if not IsFading then
                Drawings.LastColor = ForceColor
            end

            Drawings.Chams.Enabled = Character and Health > 0 and flags['ESP/ChamsEnabled' .. TeamFlag]
            --
            if Drawings.Chams.Enabled then
                local FillColor = ForceColor or (RainbowEnabled and table.find(flags['ESP/Sets' .. TeamFlag], 'Rainbow Chams') and ESP.Color1) or flags['ESP/ChamsFillColor' .. TeamFlag].Color
                local OutlineColor = ForceColor or (RainbowEnabled and table.find(flags['ESP/Sets' .. TeamFlag], 'Rainbow Chams') and ESP.Color2) or flags['ESP/ChamsOutlineColor' .. TeamFlag].Color
                Drawings.Chams.FillTransparency = flags['ESP/ChamsFillColor' .. TeamFlag].Transparency
                Drawings.Chams.OutlineTransparency = flags['ESP/ChamsOutlineColor' .. TeamFlag].Transparency
                Drawings.Chams.FillColor = Lerp(FillColor, HitColor or FillColor, Drawings.HitDetectionAlpha)
                Drawings.Chams.OutlineColor = Lerp(OutlineColor, HitColor or OutlineColor, Drawings.HitDetectionAlpha)
                Drawings.Chams.DepthMode = flags['ESP/ChamsMode' .. TeamFlag]
                Drawings.Chams.Adornee = Character
            end

            if flags['ESP/BoxEnabled' .. TeamFlag] then
                if not Drawings.Box then
                    Drawings.Box = Utility:Create("Frame", {
                        Parent = ESP.ESPHolder,
                        BackgroundTransparency = 1,
                        BackgroundColor3 = Color3.fromRGB(0, 0, 0),
                        BorderSizePixel = 0,
                        Name = 'Box'
                    })

                    Drawings.BoxOutlineHolder = Utility:Create("Frame", {
                        Parent = ESP.ESPHolder,
                        BackgroundTransparency = 1,
                        BackgroundColor3 = Color3.fromRGB(0, 0, 0),
                        BorderSizePixel = 0,
                        Name = 'BoxOutlineHolder'
                    })

                    Drawings.BoxOutline = Utility:Create("UIStroke", {
                        Parent = ESP.ESPHolder,
                        Enabled = false,
                        Transparency = 1,
                        Color = Color3.fromRGB(0, 0, 0),
                        LineJoinMode = Enum.LineJoinMode.Miter,
                        ApplyStrokeMode = Enum.ApplyStrokeMode.Border
                    })

                    Drawings.FullBox = Utility:Create("UIStroke", {
                        Parent = ESP.ESPHolder,
                        Enabled = false,
                        Transparency = 1,
                        Color = Color3.fromRGB(255, 255, 255),
                        LineJoinMode = Enum.LineJoinMode.Miter,
                        ApplyStrokeMode = Enum.ApplyStrokeMode.Border
                    })

                    Drawings.Gradient1 = Utility:Create("UIGradient", {
                        Rotation = -90,
                        Parent = ESP.ESPHolder,
                        Enabled = flags['ESP/BoxGradientFill']
                    })

                    Drawings.Gradient2 = Utility:Create("UIGradient", {
                        Rotation = -90,
                        Parent = ESP.ESPHolder,
                        Enabled = false
                    })

                    Drawings.FullBox.Parent = Drawings.Box
                    Drawings.Gradient1.Parent = Drawings.Box
                    Drawings.Gradient2.Parent = Drawings.FullBox
                    Drawings.BoxOutlineHolder.Parent = Drawings.Box
                    Drawings.BoxOutline.Parent = Drawings.BoxOutlineHolder
                end

                Drawings.Box.Visible = flags['ESP/BoxEnabled' .. TeamFlag]
                Drawings.FullBox.Enabled = flags['ESP/BoxEnabled' .. TeamFlag]
                Drawings.BoxOutline.Enabled = flags['ESP/BoxEnabled' .. TeamFlag]
                Drawings.BoxOutlineHolder.Visible = flags['ESP/BoxEnabled' .. TeamFlag]
                Drawings.Gradient1.Enabled, Drawings.Gradient2.Enabled = table.find(flags['ESP/Sets' .. TeamFlag], 'Filled Box'), flags['ESP/BoxEnabled' .. TeamFlag]

                local BoxColor = ForceColor or (not Drawings.Gradient1.Enabled and flags['ESP/BoxFillColor' .. TeamFlag].Color) or Color3.fromRGB(255, 255, 255)
                Drawings.Box.Position = UDim2.new(0, XOffset, 0, YOffset)
                Drawings.Box.Size = UDim2.new(0, Width, 0, Height)
                Drawings.Box.BackgroundColor3 = Lerp(BoxColor, HitColor or BoxColor, Drawings.HitDetectionAlpha)

                Drawings.BoxOutlineHolder.Position = UDim2.new(0, 1, 0, 1)
                Drawings.BoxOutlineHolder.Size = UDim2.new(1, 0, 1, 0)
                Drawings.BoxOutlineHolder.ZIndex = Drawings.Box.ZIndex - 1

                Drawings.BoxOutline.Thickness = 1

                Drawings.FullBox.Color = Lerp(BoxColor, HitColor or BoxColor, Drawings.HitDetectionAlpha)
                Drawings.FullBox.Thickness = 1

                if Drawings.Gradient1.Enabled then
                    Drawings.Gradient1.Color = (RainbowEnabled and table.find(flags['ESP/Sets' .. TeamFlag], 'Rainbow Box') and ESP.RainbowColor) or ColorSequence.new{ColorSequenceKeypoint.new(0, flags['ESP/BoxGradient1' .. TeamFlag].Color), ColorSequenceKeypoint.new(.5, flags['ESP/BoxGradient2' .. TeamFlag].Color), ColorSequenceKeypoint.new(1, flags['ESP/BoxFillColor' .. TeamFlag].Color)}
                    Drawings.Gradient2.Color = Drawings.Gradient1.Color
                end
            elseif Drawings.Box then
                Drawings.Box:Destroy()
                Drawings.BoxOutlineHolder:Destroy()
                Drawings.BoxOutline:Destroy()
                Drawings.FullBox:Destroy()
                Drawings.Gradient1:Destroy()
                Drawings.Gradient2:Destroy()

                Drawings.Box = nil
                Drawings.BoxOutlineHolder = nil
                Drawings.BoxOutline = nil
                Drawings.FullBox = nil
                Drawings.Gradient1 = nil
                Drawings.Gradient2 = nil
            end

            if flags['ESP/HealthBarEnabled' .. TeamFlag] then
                if not Drawings.Healthbar then
                    Drawings.Healthbar = Utility:Create("Frame", {
                        Parent = ESP.ESPHolder,
                        Name = 'Healthbar',
                        BackgroundColor3 = Color3.fromRGB(255, 255, 255),
                        BackgroundTransparency = 1,
                        BorderSizePixel = 0
                    })

                    Drawings.BehindHealthbar = Utility:Create("Frame", {
                        Parent = ESP.ESPHolder,
                        ZIndex = -1,
                        BackgroundColor3 = Color3.fromRGB(0, 0, 0),
                        BackgroundTransparency = 1,
                        BorderSizePixel = 0
                    })

                    Drawings.HealthbarGradient = Utility:Create("UIGradient", {
                        Parent = ESP.ESPHolder,
                        Enabled = flags['ESP/HealthBarGradient'],
                        Rotation = -90
                    })

                    Drawings.HealthbarGradient.Parent = Drawings.Healthbar
                end

                Drawings.Healthbar.Visible, Drawings.BehindHealthbar.Visible = flags['ESP/HealthBarEnabled' .. TeamFlag], flags['ESP/HealthBarEnabled' .. TeamFlag]

                local HealthbarColor = ForceColor or (RainbowEnabled and table.find(flags['ESP/Sets' .. TeamFlag], 'Rainbow Healthbar') and Color3.new(1,1,1)) or (table.find(flags['ESP/Sets'..TeamFlag], 'Health Lerp') and Lerp(flags['ESP/HealthColor2' .. TeamFlag].Color, flags['ESP/HealthColor1' .. TeamFlag].Color, Drawings.HealthFade.Value)) or flags['ESP/BarColor' .. TeamFlag].Color
                Drawings.Healthbar.Position = UDim2.new(0, XOffset - 6, 0, YOffset + Height * (1 - Drawings.HealthFade.Value))
                Drawings.Healthbar.Size = UDim2.new(0, flags['ESP/HealthBarSize' .. TeamFlag], 0, Height * Drawings.HealthFade.Value)
                Drawings.Healthbar.BackgroundColor3 = Lerp(HealthbarColor, HitColor or HealthbarColor, Drawings.HitDetectionAlpha)

                Drawings.BehindHealthbar.Position = UDim2.new(0, XOffset - 6, 0, YOffset)
                Drawings.BehindHealthbar.Size = UDim2.new(0, flags['ESP/HealthBarSize' .. TeamFlag] + 1, 0, Height + 1)

                Drawings.HealthbarGradient.Enabled = table.find(flags['ESP/Sets' .. TeamFlag], 'Healthbar Gradient')

                if Drawings.HealthbarGradient.Enabled then
                    Drawings.HealthbarGradient.Color = (RainbowEnabled and table.find(flags['ESP/Sets' .. TeamFlag], 'Rainbow Healthbar') and ESP.RainbowColor) or ColorSequence.new{ColorSequenceKeypoint.new(0, flags['ESP/HealthBarGradient1' .. TeamFlag].Color), ColorSequenceKeypoint.new(0.5, flags['ESP/HealthBarGradient2' .. TeamFlag].Color), ColorSequenceKeypoint.new(1, flags['ESP/HealthBarGradient3' .. TeamFlag].Color)}
                end
            elseif Drawings.Healthbar then
                Drawings.Healthbar:Destroy()
                Drawings.BehindHealthbar:Destroy()
                Drawings.HealthbarGradient:Destroy()

                Drawings.Healthbar = nil
                Drawings.BehindHealthbar = nil
                Drawings.HealthbarGradient = nil
            end

            if flags['ESP/HealthTextEnabled' .. TeamFlag] then
                if not Drawings.HealthText then
                    Drawings.HealthText = Utility:Create("TextLabel", {
                        Position = UDim2.new(0.5, 0, 0, 31),
                        Size = UDim2.new(0, 100, 0, 20),
                        AnchorPoint = Vector2.new(0.5, 0.5),
                        Parent = ESP.ESPHolder,
                        BackgroundTransparency = 1,
                        TextColor3 = Color3.fromRGB(255, 255, 255),
                        FontFace = ESP.Font2,
                        TextSize = 7,
                        TextStrokeTransparency = 1,
                        RichText = true,
                        Visible = false,
                        TextTransparency = 1,
                        ZIndex = 2147483647
                    })

                    Drawings.HealthTextOutline = Utility:Create("TextLabel", {
                        Position = UDim2.new(0.5, 1, 0, 32),
                        Size = UDim2.new(0, 100, 0, 20),
                        AnchorPoint = Vector2.new(0.5, 0.5),
                        Parent = ESP.ESPHolder,
                        BackgroundTransparency = 1,
                        TextColor3 = Color3.fromRGB(0, 0, 0),
                        FontFace = ESP.Font2,
                        TextSize = 7,
                        TextStrokeTransparency = 1,
                        RichText = true,
                        Visible = false,
                        TextTransparency = 1,
                        ZIndex = 2147483646
                    })
                end

                Drawings.HealthText.Visible = Drawings.HealthFade.Value < 1 and flags['ESP/HealthTextEnabled' .. TeamFlag]
                Drawings.HealthTextOutline.Visible = Drawings.HealthText.Visible

                local HealthTextStr = tostring(math.floor(Drawings.HealthFade.Value * 100))
                Drawings.HealthText.Text = HealthTextStr
                Drawings.HealthTextOutline.Text = HealthTextStr
                Drawings.HealthText.Position = UDim2.new(0, XOffset - 6, 0, YOffset + Height * (1 - Drawings.HealthFade.Value) - 5)
                Drawings.HealthTextOutline.Position = Drawings.HealthText.Position + UDim2.new(0, 1, 0, 1)

                local HealthTextColor = ForceColor or (table.find(flags['ESP/Sets' .. TeamFlag], 'Health Lerp') and Lerp(flags['ESP/HealthColor2' .. TeamFlag].Color, flags['ESP/HealthColor1' .. TeamFlag].Color, Drawings.HealthFade.Value)) or flags['ESP/HealthTextColor1' .. TeamFlag].Color
                Drawings.HealthText.TextColor3 = Lerp(HealthTextColor, HitColor or HealthTextColor, Drawings.HitDetectionAlpha)
            elseif Drawings.HealthText then
                Drawings.HealthText:Destroy()
                Drawings.HealthTextOutline:Destroy()

                Drawings.HealthText = nil
                Drawings.HealthTextOutline = nil
            end

            local NameText = flags['ESP/NameEnabled' .. TeamFlag] and Player.Name
            local NameColor = ForceColor or flags['ESP/NameColor1' .. TeamFlag].Color
            local NamePosition = flags['ESP/NamePosition'..TeamFlag]

            local DistanceText = flags['ESP/DistanceEnabled' .. TeamFlag] and tostring(math.round(Distance / 3))..'m'
            local DistanceColor = ForceColor or flags['ESP/DistanceColor1' .. TeamFlag].Color
            local DistancePosition = flags['ESP/DistancePosition'..TeamFlag]
            local LerpedDistanceColor = Lerp(DistanceColor, HitColor or DistanceColor, Drawings.HitDetectionAlpha)

            if NameText or DistanceText then
                if not Drawings.Name then
                    Drawings.Name = Utility:Create("TextLabel", {
                        Position = UDim2.new(0.5, 0, 0, -11),
                        Size = UDim2.new(0, 100, 0, 20),
                        AnchorPoint = Vector2.new(0.5, 0.5),
                        Parent = ESP.ESPHolder,
                        BackgroundTransparency = 1,
                        TextColor3 = Color3.fromRGB(255, 255, 255),
                        FontFace = ESP.Font,
                        TextSize = ESP.FontSize,
                        TextStrokeTransparency = 1,
                        RichText = true,
                        Visible = false,
                        TextTransparency = 1,
                        ZIndex = 2
                    })

                    Drawings.NameOutline = Utility:Create("TextLabel", {
                        Position = UDim2.new(0.5, 1, 0, -10),
                        Size = UDim2.new(0, 100, 0, 20),
                        AnchorPoint = Vector2.new(0.5, 0.5),
                        Parent = ESP.ESPHolder,
                        BackgroundTransparency = 1,
                        TextColor3 = Color3.fromRGB(0, 0, 0),
                        FontFace = ESP.Font,
                        TextSize = ESP.FontSize,
                        TextStrokeTransparency = 1,
                        RichText = true,
                        Visible = false,
                        TextTransparency = 1,
                        ZIndex = 1
                    })
                end

                if not Drawings.Distance then
                    Drawings.Distance = Utility:Create("TextLabel", {
                        Position = UDim2.new(0.5, 0, 0, 11),
                        Size = UDim2.new(0, 100, 0, 20),
                        AnchorPoint = Vector2.new(0.5, 0.5),
                        Parent = ESP.ESPHolder,
                        BackgroundTransparency = 1,
                        TextColor3 = Color3.fromRGB(255, 255, 255),
                        FontFace = ESP.Font,
                        TextSize = ESP.FontSize,
                        TextStrokeTransparency = 1,
                        RichText = true,
                        Visible = false,
                        TextTransparency = 1,
                        ZIndex = 2
                    })

                    Drawings.DistanceOutline = Utility:Create("TextLabel", {
                        Position = UDim2.new(0.5, 1, 0, 12),
                        Size = UDim2.new(0, 100, 0, 20),
                        AnchorPoint = Vector2.new(0.5, 0.5),
                        Parent = ESP.ESPHolder,
                        BackgroundTransparency = 1,
                        TextColor3 = Color3.fromRGB(0, 0, 0),
                        FontFace = ESP.Font,
                        TextSize = ESP.FontSize,
                        TextStrokeTransparency = 1,
                        RichText = true,
                        Visible = false,
                        TextTransparency = 1,
                        ZIndex = 1
                    })
                end

                Drawings.Distance.Visible = NameText or DistanceText
                Drawings.DistanceOutline.Visible = NameText or DistanceText

                Drawings.Name.Visible = NameText or DistanceText
                Drawings.NameOutline.Visible = NameText or DistanceText

                if DistanceText and DistancePosition == NamePosition then
                    DistanceText = '['..DistanceText..']'
                end

                local DistanceColorText = DistanceText and string.format('<font color="rgb(%d, %d, %d)">'..DistanceText..'</font>', LerpedDistanceColor.R * 255, LerpedDistanceColor.G * 255, LerpedDistanceColor.B * 255) or ''

                local NewText = (DistanceText or '') .. (NameText or '')
                local GsubText = string.sub(NewText, 12, #NewText)

                local TopText = (((DistancePosition ==  'Top' and DistanceColorText) or '') .. ((NamePosition == 'Top' and NameText) or '')):gsub(GsubText, '')
                local BottomText = (((DistancePosition ==  'Bottom' and DistanceColorText) or '') .. ((NamePosition == 'Bottom' and NameText) or '')):gsub(GsubText, '')
                local TopTextOutline = (((DistancePosition ==  'Top' and DistanceText) or '') .. ((NamePosition == 'Top' and NameText) or '')):gsub(GsubText, '')
                local BottomTextOutline = (((DistancePosition ==  'Bottom' and DistanceText) or '') .. ((NamePosition == 'Bottom' and NameText) or '')):gsub(GsubText, '')

                local ShouldAddEllipsis = #GsubText > 0
                Drawings.Name.Text = TopText .. (ShouldAddEllipsis and '..' or '')
                Drawings.Distance.Text = BottomText .. (ShouldAddEllipsis and '..' or '')
                Drawings.NameOutline.Text = TopTextOutline .. (ShouldAddEllipsis and '..' or '')
                Drawings.DistanceOutline.Text = BottomTextOutline .. (ShouldAddEllipsis and '..' or '')

