                    Drawings.Name.TextColor3 = Lerp(NameColor, HitColor or NameColor, Drawings.HitDetectionAlpha)
                    Drawings.Name.Position = UDim2.new(0, ScreenPosition.X, 0, YOffset - 9)
                    Drawings.NameOutline.Position = Drawings.Name.Position + UDim2.new(0, 1, 0, 1)
