                    Drawings.Distance.Position = UDim2.new(0, ScreenPosition.X, 0, ScreenPosition.Y + Height / 2 + 8)
                    Drawings.DistanceOutline.Position = Drawings.Distance.Position + UDim2.new(0, 1, 0, 1)
                end
            else
                if Drawings.Name then
                    Drawings.Name:Destroy()
                    Drawings.NameOutline:Destroy()

                    Drawings.Name = nil
                    Drawings.NameOutline = nil
                end

                if Drawings.Distance then
                    Drawings.Distance:Destroy()
                    Drawings.DistanceOutline:Destroy()

                    Drawings.Distance = nil
                    Drawings.DistanceOutline = nil
                end
            end

            if flags['ESP/WeaponEnabled' .. TeamFlag] then
                if not Drawings.Weapon then
                    Drawings.Weapon = Utility:Create("ImageLabel", {
                        Parent = ESP.ESPHolder,
                        BackgroundTransparency = 1,
                        BorderColor3 = Color3.fromRGB(0,0,0),
                        BorderSizePixel = 0,
                        Size = UDim2.new(0,40,0,40),
                        ScaleType = Enum.ScaleType.Fit,
                        ImageTransparency = 1,
                        ZIndex = 2
                    })

                    Drawings.WeaponOutline = Utility:Create("ImageLabel", {
                        Parent = ESP.ESPHolder,
                        BackgroundTransparency = 1,
                        ImageColor3 = Color3.new(),
                        BorderColor3 = Color3.fromRGB(0,0,0),
                        BorderSizePixel = 2,
                        Size = UDim2.new(0,40,0,40),
                        ScaleType = Enum.ScaleType.Fit,
                        ImageTransparency = 1,
                        ZIndex = 1
                    })

                    Drawings.WeaponGradient = Utility:Create("UIGradient", {
                        Rotation = -90,
                        Parent = ESP.ESPHolder,
                        Enabled = false
                    })

                    Drawings.WeaponGradient.Parent = Drawings.Weapon
                end

                Drawings.Weapon.Visible = flags['ESP/WeaponEnabled' .. TeamFlag]
                Drawings.WeaponOutline.Visible = flags['ESP/WeaponEnabled' .. TeamFlag]
                Drawings.WeaponGradient.Enabled = flags['ESP/WeaponEnabled' .. TeamFlag]

                local WeaponName = Character and Character:FindFirstChild('EquippedTool')
                local WeaponColor = ForceColor or flags['ESP/WeaponColor1' .. TeamFlag].Color
                Drawings.Weapon.BackgroundTransparency = 1
                Drawings.Weapon.Size = UDim2.new(0, 42, 0, 14)
                Drawings.Weapon.ImageColor3 = Lerp(WeaponColor, HitColor or WeaponColor, Drawings.HitDetectionAlpha)
                Drawings.Weapon.Position = UDim2.new(0, ScreenPosition.X - 21, 0 , ScreenPosition.Y + Height / 2 + ((Drawings.Distance.Visible and 14) or 4))
                Drawings.Weapon.Image = (WeaponName and ESP.GetWeaponIcon(WeaponName.Value)) or (not RootPart and Drawings.Weapon.Image) or 'rbxassetid://'

                Drawings.WeaponOutline.BackgroundTransparency = 1
                Drawings.WeaponOutline.Size = Drawings.Weapon.Size
                Drawings.WeaponOutline.Position = Drawings.Weapon.Position + UDim2.new(0, 1, 0, 1)
                Drawings.WeaponOutline.Image = Drawings.Weapon.Image

                Drawings.WeaponGradient.Color = (ForceColor and ColorSequence.new(Color3.new(1,1,1))) or (RainbowEnabled and table.find(flags['ESP/Sets' .. TeamFlag], 'Rainbow Weapon') and ESP.RainbowColor) or ColorSequence.new{ColorSequenceKeypoint.new(0, flags['ESP/WeaponColor1' .. TeamFlag].Color), ColorSequenceKeypoint.new(1, flags['ESP/WeaponColor2' .. TeamFlag].Color)}
            elseif Drawings.Weapon then
                Drawings.Weapon:Destroy()
                Drawings.WeaponOutline:Destroy()
                Drawings.WeaponGradient:Destroy()

                Drawings.Weapon = nil
                Drawings.WeaponOutline = nil
                Drawings.WeaponGradient = nil
            end
        end

        if ThirdPersonEnabled then
            Camera.CFrame = OldCameraCFrame
        end
    end
end

