do
    function SilentAim:UpdateTarget(Enabled, FieldOfView, MaxDistance, BodyParts, ScreenOrigin, Checks, SortType)
        SilentAim.Targets = {}
        if not Enabled or (flags['Rage/Enabled'] and flags['Rage/Ragebot'].Active) then return end

        local GamePlayers = Players:GetPlayers()
        local LocalOrigin = (LocalPlayer.Character and LocalPlayer.Character:FindFirstChild('HumanoidRootPart')) or Camera.CFrame
        local Vector2Origin = (ScreenOrigin == 'Display' and Camera.ViewportSize / 2) or InputService:GetMouseLocation()

        local TeamCheck = table.find(Checks,'Teammates')
        local FriendCheck = table.find(Checks,'Friends')
        local VisibleCheck = not flags['Legit/SilentAimWallbang'] and table.find(Checks,'Unpenetrable')
        local OnScreenCheck = table.find(Checks,'Off Screen')
        local ForceFieldCheck = table.find(Checks,'ForceField')

        local Weapon, Success, WeaponDamage, WeaponFireRate, WeaponPenetration, WeaponRangeModifier, WeaponArmorPenetration

        if VisibleCheck then
            Weapon = typeof(Client.gun) == 'Instance' and Client.gun
            if not Weapon then return end

            Success, WeaponDamage, WeaponFireRate, WeaponPenetration, WeaponRangeModifier, WeaponArmorPenetration = pcall(function()
                local IsMelee = flags['Rage/KnifeEnabled'] and Weapon:FindFirstChild('Melee')

                local Damage           = (IsMelee and 100)  or Weapon.DMG.Value
                local FireRate         = (IsMelee and 0.45) or Weapon.FireRate.Value
                local Penetration      = (IsMelee and 10)   or Weapon.Penetration.Value
                local RangeModifier    = (IsMelee and 4096) or Weapon.RangeModifier.Value
                local ArmorPenetration = (IsMelee and 100)  or Weapon.ArmorPenetration.Value

                return Damage, FireRate, Penetration, RangeModifier, ArmorPenetration
            end)
        end

        for _,Player in GamePlayers do
            if Player == LocalPlayer then continue end
            --
            if TeamCheck and Player.Team == LocalPlayer.Team then continue end
            --
            if FriendCheck and LocalPlayer:IsFriendsWith(Player.UserId) then continue end
            --
            local Alive, Character, RootPart, _, Humanoid = Utility:GetAliveInfo(Player)
            if not Alive then continue end
            --
            if ForceFieldCheck and Character:FindFirstChild('ForceField') then continue end
            --
            local Distance = (RootPart.Position - LocalOrigin.Position).Magnitude
            if Distance > MaxDistance then continue end
            --
            local TargetIndex = #SilentAim.Targets + 1

            for _,BodyPart in BodyParts do
                local Part = Character:FindFirstChild(BodyPart)
                if not Part then continue end

                local MultiPoints = SilentAim:Scan(Part, flags['Legit/MultiPointsEnabled'], flags['Legit/SilentAimMaxPoints'], flags['Legit/SilentAimScale'])

                for _,Point in MultiPoints do
                    local ScreenPosition, OnScreen = Camera.WorldToViewportPoint(Camera, Point)
                    if OnScreenCheck and not OnScreen then continue end
                    --
                    local Magnitude = (Vector2.new(ScreenPosition.X, ScreenPosition.Y) - Vector2Origin).Magnitude
                    if FieldOfView and Magnitude > FieldOfView then continue end
                    --

                    local Damage, DamageModifier = 0, 1
                    if VisibleCheck then
                        if flags['Legit/PenetrationMultiplier'] == 0 and not Utility:VisibleCheck(Character, LocalOrigin.Position, Point)then
                            continue
                        end

                        local DistanceDamageModifier = Ragebot:GetDistanceDamageModifier(Distance, WeaponRangeModifier)

                        local PlayerHasKevlar = Player:FindFirstChild("Kevlar") or Player:FindFirstChild("Helmet")
                        local KevlarModifier = (PlayerHasKevlar and Ragebot:GetKevlarDamageModifier(WeaponArmorPenetration)) or 1

                        local MinimumDamage = flags['Legit/MinDamage']

                        local ModifiedDamage = WeaponDamage * Ragebot.BodyPartModifier[Part.Name] * flags['Rage/DamageMultiplier'] * DistanceDamageModifier * KevlarModifier
                        if (ModifiedDamage < MinimumDamage) then continue end

                        local CalculatedPenetration = WeaponPenetration * 0.01 * flags['Legit/PenetrationMultiplier']
                        Damage, DamageModifier = Ragebot:CalculateDamage(LocalOrigin.Position, Point, Character, CalculatedPenetration > 0.01, ModifiedDamage, MinimumDamage, CalculatedPenetration)

                        if DamageModifier < 0.01 then continue end
                    end
                    --
                    local PreviousInfo = SilentAim.Targets[TargetIndex]
                    if PreviousInfo and (PreviousInfo.ViewportDistance < Magnitude) then continue end
                    --
                    SilentAim.Targets[TargetIndex] = {
                        ["Player"] = Player,
                        ['Health'] = Humanoid.Health,
                        ['Origin'] = LocalOrigin.Position,
                        ['HitPart'] = Part,
                        ["Distance"] = Distance,
                        ['DamageModifier'] = DamageModifier,
                        ["PlayerPosition"] = Point,
                        ['PlayerOnScreen'] = OnScreen,
                        ['ViewportDistance'] = Magnitude,
                        ['ViewportPosition'] = ScreenPosition
                    }
                end
            end
        end

        table.sort(SilentAim.Targets,function(Index1,Index2)
            return Index1[SortType] < Index2[SortType]
        end)

        return SilentAim.Targets[1]
    end
end

