    function Ragebot:RegisterHit(HitPart, Position, Weapon, DamageModifier, WallbangEnabled, NoFireAnimation)
        if not NoFireAnimation then
            Ragebot.FakeShoot()
        end

        HitPartRemote:FireServer(HitPart, Position, Weapon, 0, 0--[[LocalPlayer.Character.gun]], 0, DamageModifier, WallbangEnabled, WallbangEnabled, 0--[[Nan]], 0--[[Workspace.DistributedTime.Value]], 0--[[Nan]], true, nil,nil,nil,nil,nil ,nil,nil,nil,nil,nil ,nil,nil,nil)
    end

    function Ragebot:ProcessHit(OriginalHitPart, Weapon, DamageModifier, WallbangEnabled)
        thread(function()
            Visuals.LastHitPart = OriginalHitPart

            if flags['Visual/HitLogEnabled'] then
                --setthreadidentity(8)

                local DamageLog = FindChild(LocalPlayer.DamageLogs, OriginalHitPart.Parent.Name)
                if DamageLog and DamageLog.DMG.Value == 0 then
                    Visuals.Log('hit registration failed, due to target is using god mode exploit', flags['Visual/HitLogType'], flags['Visual/HitLogLifeTime'])

                    return --setthreadidentity(7)
                end

                local Success, IsGodMode = pcall(function()
                    local Health = LocalPlayer.Character.Humanoid.Health
                    return Health ~= Health
                end); if Success and IsGodMode then
                    Visuals.Log('hit registration failed, due to localplayer is using god mode exploit', flags['Visual/HitLogType'], flags['Visual/HitLogLifeTime'])

                    return --setthreadidentity(7)
                end
            end

            if table.find(flags['Rage/Exploits'], 'infinite damage') then
                DamageModifier = 9e999
            end

            local FinalWeapon = flags['Rage/TrollWeaponEnabled'] and flags['Rage/TrollWeapon']
            if FinalWeapon then
                if flags['Rage/RandomWeaponEnabled'] then
                    local RandomWeapons = Ragebot.RandomWeapons
                    FinalWeapon = RandomWeapons[math.random(1, #RandomWeapons)]
                end

                FinalWeapon = string.gsub(FinalWeapon, " %(broken weapon%)", "")
            end

            local IsMelee = FinalWeapon and FindChild(ReplicatedStorage.Weapons[FinalWeapon], 'Melee') ~= nil

            Ragebot:HitPart(OriginalHitPart, (flags['Rage/TrollWeaponEnabled'] and (flags['Rage/TrollWeaponType'] == 'Replace Argument' and FinalWeapon) or Weapon), DamageModifier, IsMelee or WallbangEnabled)

            if FinalWeapon and flags['Rage/TrollWeaponType'] == 'Re-fire' then
                Ragebot:HitPart(OriginalHitPart, FinalWeapon, 9e999, IsMelee or WallbangEnabled)
            end

            return table.find(flags['Rage/Exploits'], 'hide kills') and Ragebot:HitPart(OriginalHitPart, 'Everything', DamageModifier, true)
        end)
    end

    function Ragebot:UpdateForwardTracks(Player)
        local ForwardTrackHolder = Ragebot.ForwardTrackHolder
        local PlayerForwardTracks = ForwardTrackHolder and ForwardTrackHolder:FindFirstChild(Player.Name)

        local Character = Player.Character

        if not flags['Rage/ForwardTrackEnabled'] or not Character then
            return PlayerForwardTracks and PlayerForwardTracks:Destroy()
        end

        if not PlayerForwardTracks then
            PlayerForwardTracks = Utility:Create("Folder", {Parent = ForwardTrackHolder, Name = Player.Name})
        end

        local SelectedParts = flags['Rage/BodyPart']

        for _, PartName in SelectedParts do
            local Part = Character:FindFirstChild(PartName)
            if not Part then continue end

            local ForwardTrack = PlayerForwardTracks:FindFirstChild(Part.Name)
            local Highlight = ForwardTrack and ForwardTrack:FindFirstChild(Part.Name)

            if not ForwardTrack or not Highlight then
                ForwardTrack = Utility:Create("Part", {Parent = PlayerForwardTracks, Size = Part.Size, CanCollide = false, Anchored = true, Name = Part.Name, Transparency = 1})
                Highlight = Utility:Create("BoxHandleAdornment", {Parent = ForwardTrack, Name = Part.Name, Size = ForwardTrack.Size, AlwaysOnTop = true, ZIndex = 10, Adornee = ForwardTrack})
            end

            Highlight.Color3 = flags['Rage/ForwardTrackColor'].Color
            Highlight.Transparency = flags['Rage/ForwardTrackColor'].Transparency

            local MagnitudeLimit = flags['Rage/ForwardTrack'] * 1.5
            local CalculatedVelocity = Vector3.new(Part.Velocity.X, -1/4096, Part.Velocity.Z) * flags['Rage/ForwardTrack'] * Utility:GetPing()

            if CalculatedVelocity.Magnitude > MagnitudeLimit then
                CalculatedVelocity = CalculatedVelocity.Unit * MagnitudeLimit
            end

            ForwardTrack.CFrame = CFrame.new(Part.Position + CalculatedVelocity)
        end
    end

    function Ragebot:ClearForwardTracks(Player)
        local ForwardTrackHolder = Ragebot.ForwardTrackHolder

        if Player then
            local PlayerForwardTracks = ForwardTrackHolder:FindFirstChild(Player.Name)
            return PlayerForwardTracks and PlayerForwardTracks:Destroy()
        end

        return ForwardTrackHolder and ForwardTrackHolder:ClearAllChildren()
    end

    function Ragebot:GetForwardTracks(Player)
        local PlayerForwardTracks = Ragebot.ForwardTrackHolder:FindFirstChild(Player.Name)
        return PlayerForwardTracks and PlayerForwardTracks:GetChildren()
    end

    function Ragebot:GetHitParts(Player, Character)
        local Instances = {}

        for _, Region in flags['Rage/BodyPart'] do
            local PartNames = Ragebot.HitParts[Region]

            for _, PartName in PartNames do
                local HitPart = Character and Character:FindFirstChild(PartName)
                if not HitPart then continue end

                table.insert(Instances, HitPart)

                local ForwardTracks = Ragebot:GetForwardTracks(Player)
                if not ForwardTracks then continue end

                for _, ExtrapolatedPart in ForwardTracks do
                    table.insert(Instances, ExtrapolatedPart)
                end
            end
        end

        return Instances
    end

	function Ragebot:GetKevlarDamageModifier(ArmorPen)
		return 0.01 * ArmorPen
	end

	function Ragebot:GetDistanceDamageModifier(Distance, RangeModifier)
		return math.clamp((RangeModifier / 100) ^ (Distance / (500 * 0.0694)), 0.45, 1)
    end

    function Ragebot:CalculateDamage(Origin, Position, Character, PenetrateWalls, DefaultDamage, MinimumDamage, WeaponPenetration)
        local IgnoreList = table.clone(Ragebot.Ignores)
        local MaterialModifiers = Ragebot.MaterialModifiers
        local ForwardTrackHolder = Ragebot.ForwardTrackHolder

        local PenetrationPasses = 0
        local CurrentDamageMultiplier = 1
        local AccumulatedPenetrationCost = 0

        local RayDirection = Position - Origin

        local IgnoreParams = RaycastParams.new()
        IgnoreParams.FilterType = Enum.RaycastFilterType.Exclude
        IgnoreParams.FilterDescendantsInstances = IgnoreList

        local WhitelistParams = RaycastParams.new()
        WhitelistParams.FilterType = Enum.RaycastFilterType.Include

        while true do
            local RaycastResult = Workspace:Raycast(Origin, RayDirection, IgnoreParams)
            if not RaycastResult then break end

            local IntersectedPart = RaycastResult.Instance
            local IntersectedPartParent = IntersectedPart.Parent

            if IntersectedPartParent == Character or IntersectedPartParent.Parent == ForwardTrackHolder then
                return DefaultDamage, CurrentDamageMultiplier
            elseif not PenetrateWalls or IntersectedPart.Name == "nowallbang" then
                break
            end

            local IntersectedMaterial = RaycastResult.Material.Name
            local PartModifierInstance = IntersectedPart:FindFirstChild("PartModifier")
            local MaterialResistanceFactor = (PartModifierInstance and tonumber(PartModifierInstance.Value)) or MaterialModifiers[IntersectedMaterial] or (IntersectedPart.Name == "Grate" and 0.1) or 0

            if MaterialResistanceFactor > 0 then
                PenetrationPasses += 1
                if PenetrationPasses > 4 then
                    break
                end
            end

            WhitelistParams.FilterDescendantsInstances = { IntersectedPart }

            local IntersectionPoint = RaycastResult.Position

            local WallExitResult = Workspace:Raycast(IntersectionPoint + RayDirection, RayDirection * -2, WhitelistParams)
            if not WallExitResult then break end

            local WallExitPoint = WallExitResult.Position
            local WallThickness = (WallExitPoint - IntersectionPoint).Magnitude
            AccumulatedPenetrationCost = math.min(WeaponPenetration, AccumulatedPenetrationCost + WallThickness * MaterialResistanceFactor)

            if WeaponPenetration < AccumulatedPenetrationCost then break end

            CurrentDamageMultiplier = CurrentDamageMultiplier - AccumulatedPenetrationCost / WeaponPenetration
            if CurrentDamageMultiplier <= 0 then break end

            DefaultDamage *= CurrentDamageMultiplier
            if DefaultDamage < MinimumDamage then break end

            table.insert(IgnoreList, IntersectedPart)
            IgnoreParams.FilterDescendantsInstances = IgnoreList
        end

        return 0, 0
    end

    function Ragebot:EliminateTargets()
        --local R = ReplicatedStorage.Events.UpdatePing
        --thread(R.FireServer, R, 0) -- idk if it helps

        local Hit = (flags['Rage/HvHEnabled'] and Ragebot.HitPart) or Ragebot.ProcessHit

        if flags['Rage/Prioritize'] and #Library.Enemies > 0 then
            local TargetLeft = false

            thread(foreach, Library.Enemies, function(_, Player)
                if Player.Parent and Player ~= LocalPlayer and Player.Status.Alive.Value then
                    TargetLeft = true
                    Hit(Ragebot, Player.Character.Head, 'MAG7', 9e999, true)
                end
            end)

            if TargetLeft then
                return
            end
        end

        local TeamEnabled, EnemyEnabled, LocalPlayerEnabled = table.find(flags['Rage/KillAllTarget'], 'Team'), table.find(flags['Rage/KillAllTarget'], 'Enemy'), table.find(flags['Rage/KillAllTarget'], 'LocalPlayer')

        thread(foreach, ESP.Players, function(Player)
            local IsTeammate = Player.Team == LocalPlayer.Team

            if ((TeamEnabled and IsTeammate) or (EnemyEnabled and not IsTeammate)) and Player.Status.Alive.Value then
                Hit(Ragebot, Player.Character.Head, 'MAG7', 9e999, true)
            end
        end)

        if not LocalPlayerEnabled then return end

        thread(pcall, function()
            LocalPlayer.Character.Humanoid.Health = 0
        end)
    end

    function Ragebot:Scan(Origin, Character, Instances, Weapon, WeaponDamage, MinimumDamage, PenetrationPower, KevlarModifier, DistanceDamageModifier, NewTick)
        for _, AvailablePart in Instances do
            local ModifiedDamage = WeaponDamage * Ragebot.BodyPartModifier[AvailablePart.Name] * flags['Rage/DamageMultiplier'] * DistanceDamageModifier * KevlarModifier
            if (ModifiedDamage < MinimumDamage) then continue end

            local Position = AvailablePart.Position
            local Positions = { Position }

            if flags['Rage/MultiPoints'] then
                table.insert(Positions, Position + Vector3.new(0, 0.5, 0))
                table.insert(Positions, Position - Vector3.new(0, 0.5, 0))
            end

            for _, Point in Positions do
                local Origins = { Origin }
                local LookCFrame = CFrame.new(Origin, Point)

                if flags['Rage/MultiPoints'] then
                    table.insert(Origins, (LookCFrame * CFrame.new(0.5, 0, 0)).Position)
                    table.insert(Origins, (LookCFrame * CFrame.new(-0.5, 0, 0)).Position)
                end

                for _, NewOrigin in Origins do
                    local Damage, DamageModifier = Ragebot:CalculateDamage(NewOrigin, Point, Character, flags['Rage/AutoWall'], ModifiedDamage, MinimumDamage, PenetrationPower)
                    if Damage <= 0 then continue end

                    Ragebot.LastShoot = NewTick
                    Ragebot:RegisterHit(AvailablePart, Position, Weapon.Name, DamageModifier * flags['Rage/DamageMultiplier'], DamageModifier < 1, flags['Rage/NoFireAnimation'])

                    if flags['Rage/DamagePrediction'] and Damage > 135 then
                        Character.Humanoid.Health = 0
                        --[[
                            switches target faster but might be failed to register hit bc of the hitpart limit,
                            cb is a fucking retarded ass game the hit reg system is ass, and thats why they should fucking kill themselves and go to the hell istg
                        ]]
                    end

                    return true
                end
            end
        end
    end

    function Ragebot.Think()
        local NewTick = tick()
        local RefreshRate = flags['Rage/ScanDelay']
        if NewTick - Ragebot.LastScan < Ragebot.ScanDelay[RefreshRate] then return end

        Ragebot.LastScan = NewTick

        local Timer = Status.Timer.Value
        local Elapsed = NewTick - Ragebot.PredictTick
        local IsInPreparation = Status.Preparation.Value
        if Elapsed > 1 and Timer == 1 and IsInPreparation then
            Ragebot.PredictTick = NewTick
        end

        local ActiveBrain = (flags['Rage/OnPreparation'] or not IsInPreparation) or (
            (IsInPreparation and Timer == 1) and Elapsed < 1 and Elapsed >= (1 - Utility:GetPing() / (flags['Rage/PingOffset'] / 100)) -- yunahook cry for this
        )
        if not ActiveBrain then return end

        local LocalPlayerCharacter = LocalPlayer.Character
        local Root = LocalPlayerCharacter and LocalPlayerCharacter:FindFirstChild('HumanoidRootPart')
        if not Root then return end

        if flags['Rage/KillAll'] then
            return Ragebot:EliminateTargets() -- FAGGOT ASS NIGGA
        end

        if not (flags['Rage/Enabled'] and flags['Rage/Ragebot'].Active) then return end

        local Weapon = Client.gun
        if typeof(Weapon) ~= 'Instance' then return end

        local Success, WeaponDamage, WeaponFireRate, WeaponPenetration, WeaponRangeModifier, WeaponArmorPenetration = pcall(function()
            local IsMelee = flags['Rage/KnifeEnabled'] and Weapon:FindFirstChild('Melee')

            local Damage           = (IsMelee and 100)  or Weapon.DMG.Value
            local FireRate         = (IsMelee and 0.45) or Weapon.FireRate.Value
            local Penetration      = (IsMelee and 10)   or Weapon.Penetration.Value
            local RangeModifier    = (IsMelee and 4096) or Weapon.RangeModifier.Value
            local ArmorPenetration = (IsMelee and 100)  or Weapon.ArmorPenetration.Value

            return Damage, FireRate, Penetration, RangeModifier, ArmorPenetration
        end)

        if not Success then
            return Ragebot:ClearForwardTracks()
        end

        if (NewTick - Ragebot.LastShoot) < (WeaponFireRate * 0.98 / flags['Rage/FireRate']) then
            return Ragebot:ClearForwardTracks()
        end

        local PenetrationPower = WeaponPenetration * 0.01 * flags['Rage/Penetration']

        local Origin = (
            (flags['Rage/Origin'] == 'Head' and Root.CFrame * CFrame.new(0, 1.5, 0)) or Camera.CFrame * CFrame.new(flags['Visual/XOffset'], flags['Visual/YOffset'], flags['Visual/ZOffset'])
        ).Position

        local Targets = (flags['Rage/Prioritize'] and Library.Enemies) or ESP.Players
        for Player in Targets do
            if Player.Team == LocalPlayer.Team then Ragebot:ClearForwardTracks(Player) continue end

            local Alive, Character, RootPart, _, Humanoid = Utility:GetAliveInfo(Player)
            if not Alive or Character:FindFirstChild('ForceField') then Ragebot:ClearForwardTracks(Player) continue end

            Ragebot:UpdateForwardTracks(Player);

            local Instances = Ragebot:GetHitParts(Player, Character)

            local Distance = (Origin - RootPart.Position).Magnitude
            local DistanceDamageModifier = Ragebot:GetDistanceDamageModifier(Distance, WeaponRangeModifier)

            local PlayerHasKevlar = Player:FindFirstChild("Kevlar") or Player:FindFirstChild("Helmet")
            local KevlarModifier = (PlayerHasKevlar and Ragebot:GetKevlarDamageModifier(WeaponArmorPenetration)) or 1

            local MinimumDamage = (not flags['Rage/AdjustMinDamage'] and flags['Rage/MinDamage']) or math.min(Humanoid.Health, flags['Rage/MinDamage'], WeaponDamage)

            if Ragebot:Scan(Origin, Character, Instances, Weapon, WeaponDamage, MinimumDamage, PenetrationPower, KevlarModifier, DistanceDamageModifier, NewTick) and not flags['Rage/MultiHits'] then
                return
            end
        end
    end
end

