do
    function Movement.Update(Delta)
        local FlyEnabled = flags['Movement/FlyEnabled'] and flags['Movement/Fly'].Active
        local SpeedEnabled = flags['Movement/SpeedEnabled'] and flags['Movement/Speed'].Active

        local Alive, _, RootPart, Head, Humanoid = Utility:GetAliveInfo(LocalPlayer)
        if not Alive then return end

        if flags['Movement/BunnyHop'] and InputService:IsKeyDown(Enum.KeyCode.Space) then
            Humanoid.Jump = true
        end

        if not FlyEnabled and not SpeedEnabled then Head.Anchored = false return end

        local MovementDirection, Direction = Zero, Camera.CFrame.LookVector * Vector3.new(1,0,1)

        if InputService:IsKeyDown(Enum.KeyCode.W) then MovementDirection += Direction end
        if InputService:IsKeyDown(Enum.KeyCode.S) then MovementDirection -= Direction end
        if InputService:IsKeyDown(Enum.KeyCode.D) then MovementDirection += Vector3.new(-Direction.Z, 0, Direction.X) end
        if InputService:IsKeyDown(Enum.KeyCode.A) then MovementDirection -= Vector3.new(-Direction.Z, 0, Direction.X) end

        if MovementDirection.Unit.X ~= MovementDirection.Unit.X then return end

        if FlyEnabled then
            Head.Anchored = true
            MovementDirection *= flags['Movement/FlySpeed'] * Delta

            local HeadCFrame = Head.CFrame
            local HeadPosition = HeadCFrame.Position
            local CameraOffset = HeadCFrame:ToObjectSpace(Camera.CFrame).Position
            local CameraCFrame = Camera.CFrame * CFrame.new(-CameraOffset.X, -CameraOffset.Y,-CameraOffset.Z + 1)
            local CameraPosition = CameraCFrame.Position

            Head.CFrame = CFrame.new(Head.Position) * (CameraCFrame - CameraPosition) * CFrame.new(CFrame.new(CameraPosition, Vector3.new(HeadPosition.X, CameraPosition.Y, HeadPosition.Z)):VectorToObjectSpace(Vector3.new(MovementDirection.X, 0, MovementDirection.Z)))
            return
        else
            Head.Anchored = false
        end

        if not SpeedEnabled then return end

        RootPart.CFrame += MovementDirection * flags['Movement/SpeedValue'] * Delta
    end
end

